Wp = 5/fs; Ws = 10/fs;    %截止频率5Hz,阻带截止频率10Hz,采样频率20Hz
%Wp = 7/fs; Ws = 10/fs;    %截止频率4Hz,阻带截止频率5Hz,采样频率20Hz
